# @lc idea=start
#
# 计算无向图中每个结点到其他结点的距离的和。
# 从叶子结点向根结点传播。统计除了向根前进方向之外的结点数与距离和。
# 之后反向再传播。方向传播的结点访问顺序与正向传播相反。
# 此时可以计算根前进方向的结点数与距离和。
# 并将此结点更新为根节点的样子。
# 
# @lc idea=end

# @lc group=

# @lc rank=


# @lc code=start
class Solution:
    def sumOfDistancesInTree(self, n: int,
                             edges: List[List[int]]) -> List[int]:
        if n == 1:
            return [0]

        res = [0] * n

        neighsMap = [[] for _ in range(n)]

        # neighbor map
        for l, r in edges:
            neighsMap[l].append(r)
            neighsMap[r].append(l)

        # neighbot count, priority queue

        neighborCounts = [len(neighs) for neighs in neighsMap]
        leafNodes = []
        for idx , c in enumerate(neighborCounts):
            if c == 1 :
                leafNodes.append(idx)

        # visited
        visited = [False] * n
        visitedOrder = []

        buffer = [None] * n
        nextNode = [None] * n 
        # min degree
        while leafNodes:
            nodeID = leafNodes.pop()

            # old data
            if visited[nodeID] :
                continue
            visited[nodeID] = True
            visitedOrder.append(nodeID)

            # neighbor
            neighborNodes = []
            for neighborNodeID in neighsMap[nodeID]:
                if  visited[neighborNodeID]:
                    neighborNodes.append(neighborNodeID)
                else:
                    nextNode[nodeID] = neighborNodeID
                    neighborCounts[neighborNodeID] -= 1
                    if neighborCounts[neighborNodeID] <= 1:
                        leafNodes.append(neighborNodeID)

                   
            # leaf node
            if len(neighborNodes) == 0:
                buffer[nodeID] = (1, 1)
                continue

            # statistics
            neighDisSum = 0
            neighNodeCount = 0

            # forward
            for neighborNode in neighborNodes:
                s, c = buffer[neighborNode]
                neighDisSum += s
                neighNodeCount += c

            res[nodeID] += neighDisSum

            buffer[nodeID] = (neighDisSum + neighNodeCount + 1,
                              neighNodeCount + 1)



        reversedOrder = list(reversed(visitedOrder))
        for nodeID in reversedOrder:
            
            if  nextNode[nodeID] is not None:
           
                    neighborNodeID =nextNode[nodeID]
                    us, _ = buffer[neighborNodeID]

                    ts, tc = buffer[nodeID]

                    ust, uct = us - (ts + tc), n - tc

                    res[nodeID] += ust

                    buffer[nodeID] = (ts + ust + uct, n)

        return res

        pass


